import React from "react";
import './group.css';
import { Link } from 'react-router-dom';
import { Navigate, useNavigate } from "react-router-dom";


function Group() {
    const navigate = useNavigate();
  return( 
    <div className="lessgo">
    <div className="b">
        <button  onClick={() => {
              navigate("/group1");}} color="green" >group1</button>
    </div>
    <div className="b"> <button>group2</button></div>
    <div className="b"> <button>math</button></div>
    </div>
);
};

export default Group;
